import React from 'react'

const Slots = (props) => {

    return (
        <div>
            {props.slots && props.slots.map(slot =>
                <li key={slot.id}>
                    <i>{slot ? slot.name : null} {slot.created_at}</i></li>
                
            )}
        </div>
    )

}

export default Slots
